import "./App.css";
import axios from "axios";
import React, { useEffect, useState } from "react";

function App() {
  const [productdeet, setDeets] = useState("");
  useEffect(() => {
    axios.get("http://localhost:3001/products").then((response) => {
      setDeets(response.data[0].description);
    });
  }, []);
  return (
    <div className="App">
      <p>{productdeet}</p>
    </div>
  );
}

export default App;
